import React, { useState } from 'react';

function SignupForm() {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    confirmPassword: '',
    accountType: '',
  });

  const [error, setError] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);

    try {
      const { username, email, password, confirmPassword, accountType } = formData;

      if (accountType === '') {
        setError('Please select an account type');
        return;
      }

      if (password !== confirmPassword) {
        setError('Passwords do not match');
        return;
      }

      if (accountType === 'admin') {
        // Handle admin sign-up logic
        console.log('Admin sign-up');
      } else if (accountType === 'student') {
        // Handle student sign-up logic
        console.log('Student sign-up');
      }
    } catch (error) {
      console.error('Sign-up error:', error);
      setError('An error occurred. Please try again later.');
    } finally {
      setIsLoading(false);
    }
  };

  return (
    <div
      className="signUp"
      style={{
        backgroundImage: `url(${process.env.PUBLIC_URL}/R().jpeg)`,
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        height: '100vh',
        width: '100vw',
      }}
    >
      <div>
        <h1>Westland Accommodation</h1>
        <h2>Sign up</h2>
        <form onSubmit={handleSubmit}>
          <label>
            <input
              type="text"
              name="username"
              placeholder="Username"
              value={formData.username}
              onChange={handleChange}
              style={{ marginBottom: '20px' }}
            />
          </label>
          <br />
          <label>
            <input
              type="email"
              name="email"
              placeholder="Email"
              value={formData.email}
              onChange={handleChange}
              style={{ marginBottom: '20px' }}
            />
          </label>
          <br />
          <label>
            <input
              type="password"
              name="password"
              placeholder="Password"
              value={formData.password}
              onChange={handleChange}
              style={{ marginBottom: '20px' }}
            />
          </label>
          <br />
          <label>
            <input
              type="password"
              name="confirmPassword"
              placeholder="Confirm Password"
              value={formData.confirmPassword}
              onChange={handleChange}
              style={{ marginBottom: '20px' }}
            />
          </label>
          <br />
          <label>
            Account Type:
            <select
              name="accountType"
              value={formData.accountType}
              onChange={handleChange}
            >
              <option value="">Select an account type</option>
              <option value="admin">Admin</option>
              <option value="student">Student</option>
            </select>
          </label>
          <br />
          {error && <p style={{ color: 'red' }}>{error}</p>}
          {isLoading ? (
            <p>Loading...</p>
          ) : (
            <button type="submit">Sign up</button>
          )}
          <p>
            Already have an account? <a href="/">Login</a>
          </p>
        </form>
      </div>
    </div>
  );
}

export default SignupForm;
